_264468760557050_1358598566_n.jpg?ig_cache_key=MTIzMTI3NDMzODE1MjYyMTczNw%3D%3D.2","width":640,"height":640}},"users_in_photo":[],"caption":{"created_time":"1460999360","text":"Cats\u0026plants!","from":{"username":"punastus","profile_picture":"https:\/\/scontent.cdninstagram.com\/t51.2885-19\/s150x150\/11950472_1630767290521629_220463652_a.jpg","id":"465332312","full_name":"Anna"},"id":"17855048626020388"},"user_has_liked":false,"id":"1231274338152621737_465332312","user":{"username":"punastus","profile_picture":"https:\/\/scontent.cdninstagram.com\/t51.2885-19\/s150x150\/11950472_1630767290521629_220463652_a.jpg","id":"465332312","full_name":"Anna"}},{"attribution":null,"tags":["healthyfood","jerf","fishcakes","dairyfree","threequartersveggies","sugarfree","cleaneating","paleodinner","veggies","thaifood","healingdiet","thai","paleo","salad","plantbased","glutenfree","healthy","paleofood","healthyinspiration","cleanfood","pescatarian","healthychoice","realfood","paleosalad","paleodiet","grainfree","paleolunch"],"type":"image","location":{"latitude":60.170833,"name":"Helsinki","longitude":24.9375,"id":736780008},"comments":{"count":0,"data":[]},"filter":"Normal","created_time":"1460999354","link":"https:\/\/www.instagram.com\/p\/BEWXXCEw2y8\/","likes":{"count":1,"data":[{"username":"healthy.happy.fitlife","profile_picture":"https:\/\/scontent.cdninstagram.com\/t51.2885-19\/s150x150\/12479444_1698531400367363_1777382933_a.jpg","id":"224425362","full_name":"\ud83c\udf34Solla\ud83c\udf34"}]},"images":{"low_resolution":{"url":"https:\/\/scontent.cdninstagram.com\/t51.2885-15\/s320x320\/e35\/12965166_1669831299933861_1722543985_n.jpg?ig_cache_key=MTIzMTI3NDI4NTk3NzUyOTUzMg%3D%3D.2","width":320,"height":320},"thumbnail":{"url":"https:\/\/scontent.cdninstagram.com\/t51.2885-15\/s150x150\/e35\/12965166_1669831299933861_1722543985_n.jpg?ig_cache_key=MTIzMTI3NDI4NTk3NzUyOTUzMg%3D%3D.2","width":150,"height":150},"standard_resolution":{"url":"https:\/\/scontent.cdninstagram.com\/t51.2885-15\/s640x640\/sh0.08\/e35\/12965166_1669831299933861_1722543985_n.jpg?ig_cache_key=MTIzMTI3NDI4NTk3NzUyOTUzMg%3D%3D.2","width":640,"height":640}},"users_in_photo":[],"caption":{"created_time":"1460999354","text":"Trying to step out of my cooking comfort zone and try new things... soo I'm starting the week with thai fish cakes (with a salad and tahini dressing)! \ud83d\ude00\ud83d\udc20 This is my own recipe that I made up kind of as I went along, but it turned out absolutely delicious and I can highly recommend it to anyone who wants a light yet filling meal! \nThe salad has corn salad, celery, cucumber, avocado, and melon and the tahini dressing is made from olive oil, tahini, peanut butter, honey, grated ginger, and a bit of apple juice. Below is the recipe for the fish cakes \ud83d\ude04\n\nMakes about 12 fish cakes: \n400 g smoked salmon \n2 parsnips \n1 egg \nLarge bunch coriander \n1\/2 tsp chili flakes \nJuice of 1 lime \nSalt \u0026 Pepper \nAlmond flour \nCoconut oil\n\nFirst peel and cut the parsnips into small pieces and steam. While they are cooking mix together the salmon, coriander, lime, chili, salt and pepper. Then when the parsnips are soft, and them and the egg into the salmon mixture. Mix thoroughly. \nNext, using your hands mold the mixture into small patties and coat both sides in almond flour. Finally fry in coconut oil on medium to high heat approximately 3 min per side! \n#paleo #paleodinner #paleolunch #paleosalad #paleodiet #paleofood #healingdiet #cleanfood #cleaneating #realfood #jerf #pescatarian #salad #fishcakes #healthy #healthyfood #healthychoice #healthyinspiration #glutenfree #grainfree #dairyfree #sugarfree #thaifood #thai #veggies #plantbased #threequartersveggies","from":{"username":"ilocooking","profile_picture":"https:\/\/scontent.cdninstagram.com\/t51.2885-19\/s150x150\/12822296_532792220215141_470159179_a.jpg","id":"3040679314","full_name":"Ilona \u0026 Jasmin"},"id":"17856236209057093"},"user_has_liked":false,"id":"1231274285977529532_3040679314","user":{"username":"ilocooking","profile_picture":"https:\/\/scontent.cdninstagram.com\/t51.2885-19\/s150x150\/12822296_532792220215141_470159179_a.jpg","id":"3040679314","full_name":"Ilona \u0026 Jasmin"}},{"attribution":null,"tags":["kontulanskeittihalli","helsinki"],"type":"image","location":{"latitude":60.170833,"name":"Helsinki","longitude":24.9375,"id":736780008},"comments":{"count":0,"data":[]},"filter":"Clarendon","created_time":"1460999332","link":"https:\/\/www.instagram.com\/p\/BEWXUVxpSgF\/","likes":{"count":5,"data":[{"username":"thegcface","profile_picture":"https:\/\/scontent.cdninstagram.com\/t51.2885-19\/11251186_503255519824056_1318106702_a.jpg","id":"5100801","full_name":"George Carberry"},{"username":"poddshake","profile_picture":"https:\/\/scontent.cdninstagram.com\/t51.2885-19\/s150x150\/12965663_1602132430107644_1254599275_a.jpg","id":"26619977","full_name":"poddshake"},{"username":"p_gordon","profile_picture":"https:\/\/scontent.cdninstagram.com\/t51.2885-19\/10899403_714278618692834_1900221574_a.jpg","id":"26106308","full_name":"Phil Gordon"},{"username":"nickconstant","profile_picture":"https:\/\/scontent.cdninstagram.com\/t51.2885-19\/10979647_386920958155580_346131181_a.jpg","id":"4370763","full_name":"Se\u00f1or Stick"}]},"images":{"low_resolution":{"url":"https:\/\/scontent.cdninstagram.com\/t51.2885-15\/s320x320\/e35\/12446345_1789597217930074_1930799085_n.jpg?ig_cache_key=MTIzMTI3NDEwMDk3MzE4NTAyOQ%3D%3D.2.l","width":320,"height":320},"thumbnail":{"url":"https:\/\/scontent.cdninstagram.com\/t51.2885-15\/s150x150\/e35\/c135.0.810.810\/12677230_1020021218091268_466571776_n.jpg?ig_cache_key=MTIzMTI3NDEwMDk3MzE4NTAyOQ%3D%3D.2.c","width":150,"height":150},"standard_resolution":{"url":"https:\/\/scontent.cdninstagram.com\/t51.2885-15\/s640x640\/sh0.08\/e35\/12446345_1789597217930074_1930799085_n.jpg?ig_cache_key=MTIzMTI3NDEwMDk3MzE4NTAyOQ%3D%3D.2.l","width":640,"height":640}},"users_in_photo":[],"caption":